import React from 'react';

class Created extends React.Component{
    render(){

        return (
            <div>
                <div className='title'>
                    {this.props.title}

                    <div className='description'>
                        {this.props.description}
                    </div>

                    <div className='url'>
                        {this.props.url}
                    </div>



                </div>
            </div>
        )
    }
}

export default Created;
